import React from 'react'
import './style.scss'
// import peopleImage from 'assets/images/people.png'
// import rigtharrow from 'assets/images/right-arrow-circle.svg'
// import catImage from 'assets/images/side-contact-img.svg'
// import Header from 'components/Header'

export default function index() {
    return (
        <div className='hero-section'>
            <section className='section-main'>
                <div class="container-fluid">
                    <div class="row row-cols-1 row-cols-md-2">
                        <div className='col-md-9 custom-col-9 bg-dark p-5'>

                        </div>
                        <div className='col-md-3 custom-col-3 bg-danger p-5'>

                        </div>
                    </div>
                </div>
            </section>
        </div>
    )
}
